INSERT INTO ceds6sc_rdx.Ref_K12_End_Of_Course_Requirement( Ref_K12_End_Of_Course_Requirement_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'LEA only', 'LEA_Only', 'This course has an end of course examination required by the LEA only.', null, 1.00 ); 
INSERT INTO ceds6sc_rdx.Ref_K12_End_Of_Course_Requirement( Ref_K12_End_Of_Course_Requirement_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'SEA only', 'SEA_Only', 'This course has an end of course examination required by the SEA only.', null, 3.00 ); 
