INSERT INTO ceds6sc_rdx.Ref_Learning_Resource_Type( Ref_Learning_Resource_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Assessment Item', 'Assessment_Item', 'A specific prompt, that defines a question or protocol for a measurable activity that triggers a response from a person used to determine whether the person has mastered a learning objective.', null, 4.00 ); 
