INSERT INTO ceds6sc_rdx.Ref_Learning_Resource_Type( Ref_Learning_Resource_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Formative assessment', 'Formative_Assessment', 'A process used by teachers and students during instruction that provides feedback to adjust ongoing teaching and learning to improve students? achievement of intended instructional outcomes. (CCSSO FAST SCASS, 2006)', null, 12.00 ); 
