INSERT INTO ceds6sc_rdx.Ref_Learning_Resource_Type( Ref_Learning_Resource_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Learning Activity', 'Learning_Activity', 'Activities engaged in by the learner for the purpose of acquiring certain skills, concepts, or knowledge, whether guided by an instructor or not.  A Lesson may define one or more learning activities.', null, 22.00 ); 
