INSERT INTO ceds6sc_rdx.Ref_Naep_Aspects_Of_Reading( Ref_Naep_Aspects_Of_Reading_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Developing Interpretation', 'Developing_Interpretation', 'To develop an interpretation, the reader must extend initial impressions to arrive at a more complete understanding of what was read. This involves linking information across parts of a text as well as focusing on specific information.', null, 1.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Naep_Aspects_Of_Reading( Ref_Naep_Aspects_Of_Reading_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Making reader/text connections', 'Making_Reader_Text_Connections', 'To make reader/text connections, the reader must link information in the text with knowledge and experience. This might include applying ideas in the text to the real world, and responses must be text based.', null, 2.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Naep_Aspects_Of_Reading( Ref_Naep_Aspects_Of_Reading_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Examining content and structure', 'Examining_Content_And_Structure', 'Examining text content and structure requires critically evaluating, comparing and contrasting, and understanding the effect of features such as irony, humor, and organization. Readers are required to stand apart from the text, consider it objectively, and evaluate its quality and appropriateness, using text content and structure.', null, 3.00 ); 
