INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Adaptive physical education', '00290', 'Programs designed to foster the development of the following physical activities: physical and motor fitness: fundamental motor skills and patterns; skills in aquatics and dance, including individual and group games; and sports (including intramural and lifetime sports). This term also includes special physical education, adapted physical education, movement education, and motor development.', null, 4.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Art therapy', '00291', 'Programs that enable individuals who have mental, emotional, social, or physical problems to achieve self-expression and emotional release by communicating their emotions and conflicts graphically through painting, drawing, sculpting or other art forms. Art therapy can be used as diagnostic tool or a treatment technique.', null, 8.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Assistive technology services', '00292', 'Programs that directly assist an individual with disabilities in the selection, acquisition, or use of an assistive technology device. Such assistance includes: 1) the evaluation of the needs of an individual, including a functional evaluation of the individual in his or her customary environment; 2) purchasing, leasing, or otherwise providing for the acquisition of assistive technology devices; 3) selecting, designing, fitting, customizing, adopting, applying, maintaining, repairing, or replacing assistive technology devices; 4) coordinating and using other therapies, interventions, or services (e.g., those associated with existing education and rehabilitation plans and programs); 5) training and technical assistance for an individual or, if appropriate, an individuals'' family members; and 6) training or technical assistance for professionals (including those providing early intervention services), employers, or other individuals who are substantially involved.', null, 12.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Audiological services', '00293', 'Services that include: 1)identification of individuals with hearing loss: 2) determination of the range, nature, and degree of hearing loss, and communication functions, by use of audiological evaluation, and speech conservation; 4) creation and administration of programs for prevention of hearing loss; 5) counseling and guidance of students, parent/guardians, and teachers regarding hearing loss; and 6) determination of an individual''s need for group and individual amplification, selecting and fitting an appropriate aid, and evaluating the effectiveness of amplification.', null, 16.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Augmentative Communication Service', '73050', 'Augmentative Communication Service is provided to the person or a group of persons.', null, 17.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Autism Spectrum Disorder Service', '73051', 'Autism Spectrum Disorder Service is provided to the person or a group of persons.', null, 18.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Behavior and Behavioral Consultation Service', '73052', 'Behavior and Behavioral Consultation Service is provided to the person or a group of persons.', null, 19.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Case management services', '00878', 'Programs that develop case plans for the evaluation, treatment and/or care of individuals who, because of age, illness, disability or other difficulties, are unable to arrange for services on their own behalf. The services also assess the individual''s needs, coordinate the delivery of services, ensure that services are obtained in accordance with the case plan, and monitor progress to ensure that services are having a desired impact.', null, 20.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Braille Service', '73053', 'Braille Service is provided to the person or a group of persons.', null, 20.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 10, 'Children''s protective services', '00295', 'Programs that investigate reports of child abuse, neglect, and abandonment, and provide for the temporary placement of a child who, for his or her own protection, has been removed from custody of his or her parent/guardians. Program staff works with families that are experiencing the problem of child abuse with the objective of facilitating continued family unification or reunification. These programs also provide ongoing support services for children in permanent placement.', null, 24.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 11, 'Communication services', '00881', 'Programs that help participants develop or refine their communication skills, usually by focusing on communication in a particular context (e.g., helping a parent/guardian communicate with a child or helping professionals communicate with their clients). Training may emphasize active listening skills, problem-solving skills, conflict resolution techniques, body language, empathy, sensitivity to the values and/or cultural background of other, genuineness and other facets of the communication process.', null, 28.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 12, 'Community recreational services', '00882', 'Programs that provide equipment and facilities that ensure individuals with special needs can participate in specific recreational activities, games, or sports of their choice, regardless of age.', null, 32.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 13, 'Curriculum planning', '73048', 'Curriculum planning is provided to the person or a group of persons.', null, 33.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 14, 'Developmental childcare program', '00334', 'An organized program that provides childcare services on a regular basis for a group of children; the program is directed toward the facilitation of several developmental areas.', null, 36.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 15, 'Early Intervention / Early Childhood Special Education Special Service', '73047', 'The design of learning environments and activities that promote the child''s acquisition of skills in a variety of developmental areas, include cognitive processes and social interaction. ', null, 37.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 16, 'Early intervention services', '00297', 'A program which provides services that: 1) are designed to meet the development needs of each child and family eligible, and are focused on enhancing the child''s development; 2) are selected in collaboration with the parent/guardian; 3) are provided under public supervision by qualified personnel, in conformity with an individualized family service plan; 4) are offered at no cost unless subject to federal or state law mandating a system of payments (including a schedule of sliding fees); and 5) meet the standards of the state.', null, 40.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 17, 'Educational therapy', '00298', 'Programs that provide diagnostic and treatment services which combine psychotherapeutic and tutorial techniques for individuals who have learning disabilities such as dyslexia, perceptual problems, emotional problems or other difficulties.', null, 44.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 18, 'ESL/Migrant Service', '73054', 'ESL/Migrant Service is provided to the person or a group of persons.', null, 45.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 19, 'Family counseling', '00299', 'Programs that offer therapeutic sessions that focus on the system of relationships and communication patterns between family members and attempt to modify those relationships and patterns to achieve greater harmony. The therapist focuses on the family as a unit rather than concentrating on the member who has been singled out as being in need of treatment.', null, 48.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 20, 'Family training, counseling, and home visits', '00333', 'Services provided, as appropriate, by social workers, psychologists, and other qualified personnel to assist the family of a child eligible under this part in understanding the special needs of the child and enhancing the child''s development.', null, 52.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 21, 'Health care', '00303', 'Programs whose primary purpose is to help individuals achieve and maintain physical well-being through the study, prevention, screening, evaluation and treatment of individuals who have illnesses, injuries, or disabilities.', null, 56.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 22, 'Independent living', '00883', 'Assistance provided to individuals with special needs including those with disabilities: 1) to learn the basic skills of daily living through individual and group counseling and instruction; 2) to experience and practice coping with real or simulated life situational demands; or 3) to use assistive devices, special equipment, or specialized assistant.', null, 60.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 23, 'Instructional Aide/Assistant/Intervener Service', '73049', 'Instructional Aide/Assistant/Intervener Service is provided to the person or a group of persons.', null, 61.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 24, 'Interpretation for the hearing impaired', '00304', 'Services that enable students who have hearing impairments to communicate their needs manually, verbally, or in writing.', null, 64.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 25, 'Medical services only for diagnostic or evaluation purposes', '00332', 'Services provided by a licensed physician to determine a child''s developmental status and need for early intervention services.', null, 68.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 26, 'Mental health counseling', '00305', 'Programs that specialize in the treatment of students who have adjustment or behavior problems, emotional disturbances, personality disorders, incipient illnesses, and/or other comparable conditions', null, 72.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 27, 'Mental health services', '00884', 'Programs that provide services to individuals who have been hospitalized for treatment of acute or chronic mental or emotional disturbances, and facilitate their return to the community. The programs also offer psychiatric treatment in a setting that is less restrictive than inpatient hospitalization.', null, 76.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 28, 'Music therapy', '00306', 'Programs that use music and music-related activities to help the student maintain mental functioning, to facilitate social and emotional growth, to promote communication, to develop constructive use of leisure time and to improve or maintain motor and perceptual skills. Music can be used as a passive agent as in the case of listening to music to aid in reminiscence, reality orientation or relaxation; or as an active creative process in which the client participates in musical production.', null, 80.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 29, 'National School Nutrition programs', '00300', 'A federally-funded program that provides supplemental nutrition in the form of a free meal, free snack, or free milk for income-eligible students who are unable to pay the cost. Public and non-profit private schools participating in the program are reimbursed for the meal/snack/milk served.', null, 84.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 30, 'Note-taking assistance', '00308', 'Programs that assist students who are unable to make their own record of classes or lectures.', null, 88.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 31, 'Nursing service', '00335', 'Services that are provided for the assessment of health status for the purpose of providing nursing care, including the identification of patterns of human response to actual or potential health problems. They also include the provision of nursing care to prevent health problems, restore or improve functioning, and promote optimal health and development. Finally, they involve the administration of medications, treatments, and regimens prescribed by a licensed physician.', null, 92.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 32, 'Nutrition services', '00336', 'Services that conduct individual assessments in nutritional history and dietary intake; anthropometrics, biochemical, and clinical variables; feeding skills and feeding problems; and food habits and food preferences. They also develop and monitor appropriate plans to address the nutritional needs of eligible children, and make referrals to appropriate community resources to carry out nutritional programs.', null, 96.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 33, 'Occupational therapy', '00309', 'Services that address the functional needs of an individual relating to adaptive development, adaptive behavior and play, and sensory, motor, and postural development. These services are designed to improve the individual''s functional ability to perform tasks in the home, school, and community settings and include: 1) identification assessment and intervention; 2) adaptation of the environment, and selection, design and fabrication of assistive and orthodontic devices to facilitate the development and promote the acquisition of functional skills; and 3) prevention or minimization of the impact of initial or future impairment, delay in development, or loss of functional ability.', null, 100.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 34, 'Orientation and mobility services', '00310', 'Programs that help individuals who are blind or who have visual impairments to develop the fundamental spatial concepts and skills that are necessary for maximum mobility and independent living. Instruction focuses on moving safely and efficiently in the school, home or community environment, and usually includes procedures for street crossings, travel in unfamiliar areas, utilization of public transportation, and appropriate use of aids such as sighted guides or canes.', null, 104.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 35, 'Parenting skills assistance', '00311', 'Programs that offer classes, groups, or other educational opportunities for parents or potential parents who want to acquire the knowledge and skills to be effective in their parenting role.', null, 108.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 36, 'Peer services', '00312', 'Programs that specialize in assisting the student through peer interaction. Such programs include peer counseling, tutoring, and leadership activities.', null, 112.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 37, 'Physical therapy', '00313', 'Services to prevent or alleviate movement dysfunction and related functional problems that include: 1) screening, evaluation, and assessment of children and youth with disabilities to identify movement dysfunction; 2) obtaining, interpreting, and integrating information appropriate to program planning to prevent or alleviate movement dysfunction and related functional problems; and 3) providing individual or group services or treatment to prevent, alleviate, or compensate for movement dysfunction and related functional problems.', null, 116.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 38, 'Psychological services', '00331', 'Services that address the psychological needs of the individual through the administering of psychological needs of the individual through the administering of psychological and developmental tests, and other assessment procedures. They also involve the interpretation of assessment results. In addition, they include obtaining, integrating, and interpreting information about individual behavior, and individual and family conditions related to learning, mental health, and development. Finally, the services also involve the planning and management of a program of psychological services, including psychological counseling for children and parents, family counseling, consultation on child development, parent training, and education programs.', null, 120.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 39, 'Reader service', '00314', 'Programs that provide textbook reading services for individuals who are blind or have visual impairments.', null, 124.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 40, 'Recreation service', '00315', 'Programs that may include: 1) assessment of leisure function; 2) therapeutic recreation services; 3) recreation programs in schools and community agencies; and 4) leisure education.', null, 128.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 41, 'Rehabilitation counseling services', '00318', 'Programs that provide a combination of treatment and education services designed to restore maximum functioning , a sense of well-being, and a personally satisfying level of independence in individuals who have temporary or permanent disabilities.', null, 132.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 42, 'Residential services', '00885', 'Programs that provide a therapeutic living environment in community-based residential facilities for individuals with special needs, including those with emotional and/or behavioral problems. Such individuals require a structure, supervised treatment program that may include individual, group, family, and other treatment modalities as appropriate.', null, 136.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 43, 'Respite Care', '73046', 'Temporary childcare services that are short-term and non-medical in nature, provided either in or out of the home. These services are designed to provide temporary relief to the primary caregiver.', null, 137.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 44, 'School clothing', '00319', 'Programs that pay for or provide new or used clothing to students who need appropriate school attire and whose parent/guardians are unable to afford these items at retail prices.', null, 140.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 45, 'School counseling', '00302', 'Programs that provide advice and guidance for students who need assistance in choosing course or areas for major study, preparing for a vocation or further education, or coping with personal or learning problems.', null, 144.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 46, 'School health nursing services', '00320', 'Services provided by a qualified school health nurse or other registered nurse/nurse practitioner.', null, 148.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 47, 'Service coordination (case management services)', '00294', 'Activities carried out by service coordinator to assist and enable an eligible student and his/her family to receive the rights, procedural safeguards, and services that are authorized to provided under the State''s early intervention program. The specific activities include: coordinating the performance of evaluations and assessments; facilitating and anticipating in the development, review, and evaluation of individualized family service plans; assisting families in identifying available service providers; coordinating and monitoring the delivery of available services; informing families of the availability of advocacy services; coordinating with medical and health providers; and facilitating the development of a transition plan to preschool services, if appropriate.', null, 152.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 48, 'Social work services', '00337', 'Services that involve making home visits to evaluate a child''s living conditions and patterns of parent-child interaction; preparing a social or emotional developmental assessment of the child within the family context; providing individual and family-group counseling with parents and other family members, and appropriate social skill-building activities with the child and parents; working with those problems in a child''s and family''s living situation (home, community, and any center where early intervention services are provided) that affect the child''s maximum utilization of early intervention services; and identifying, mobilizing, and coordinating community resources and services to enable the child and family to receive maximum benefit from early intervention services.', null, 156.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 49, 'Special transportation', '00321', 'Transportation arrangements provided to students to and from home, school, or other service sites.', null, 160.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 50, 'Speech-language therapy', '00322', 'Individual or group therapy sessions that focus on the remediation of specific communicative or pharyngeal disorders and delays in the development of communication skills including: 1) speech sounds that are omitted, replaced by substitute sounds, or distorted; 2) voice problems in which pitch, loudness or quality of voice are affected; or 3) stuttering. Therapy includes the identification of an individual with such disorders and developmental delays, including the diagnosis and appraisal of specific disorders and delays in those skills. It also includes referral for medical or other professional services necessary for the habilitation or rehabilitation of individuals with those disorders and developmental delays. Finally, it includes the provision of services for habilitation, rehabilitation, or prevention of such disorder and developmental delays.', null, 164.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 51, 'Study skills assistance', '00323', 'Programs that provide individual or small group assistance for students who want to improve their study habits, test preparation skills and test-taking techniques.', null, 168.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 52, 'Substance abuse education/prevention', '00324', 'Programs that provide a variety of services including: 1) individual, group and/or family counseling; 2) knowledge and skill-enhancing activities; and 3) structured groups that focus on family dynamics, problem solving, self-esteem, and/or similar issues. These programs care for students who are at risk of drug abuse (e.g., those who are currently in an experimental stage (light use), who have family members or peer groups who use alcohol or drugs, or who have behavioral, emotional, or other problems at home, in school, in the community, or with the criminal justice system). Substance abuse education programs also offer presentations about the risks of substance use to students at school and various other community settings.', null, 172.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 53, 'Supported employment services', '00886', 'Programs that find paid, meaningful work in a variety of integrated settings for individuals who have special needs, including those with developmental disabilities. Services include assigning a job coach to work side-by-side with each client, offering advocacy to the employer and other employees, training in basic job skills and work-related behaviors, assisting with specific tasks as needed, and providing initial and ongoing support as required to ensure that the individual retains competitive employment.', null, 176.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 54, 'Technological aids', '00887', 'Structural or sensory aids provided to students with special physical or physiological needs in order to help them to better adapt to everyday work and/or learning environments.', null, 180.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 55, 'Teen/adolescent family planning', '00325', 'Programs that offer family planning services including pregnancy counseling, birth control, and pregnancy testing which are especially designed to meet the needs and concerns of teenage students who are pregnant or are concerned about becoming pregnant or impregnating.', null, 184.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 56, 'Test assistance', '00326', 'Programs that provide assistance for students with disabilities who need help in reading or writing responses to test items. Examples of such assistance include the administration of untimed tests and the presence of test facilitators for children with autism.', null, 188.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 57, 'Translation/interpreter services', '00327', 'Services that allow individuals who can not comprehend or communicate using either the spoken or written word to understand or express themselves (e.g., foreign language translator and sign language interpreter).', null, 192.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 58, 'Transportation services', '00888', 'Services that provide transportation for individuals, or make arrangements to transport individuals, to and from sites in which they are involved in vocational or life situations.', null, 196.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 59, 'Tutoring services', '00329', 'Individualized or small group instruction for students who need assistance in learning one or more components of a prescribed curriculum. Tutoring usually supplements a regular school program, and may be provided by peer students, teachers, or other personnel at school, in an individual''s home, or at a community agency site.', null, 200.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 60, 'Vision services', '00330', 'Services that include: 1) evaluation and assessment of visual functioning, including the diagnosis and appraisal of specific visual disorders, delays, and disabilities; 2) referrals for medical or other professional services necessary for the habilitation or rehabilitation of visual functioning disorders; and 3) training for communication, communication, orientation and mobility, visual, and independent living skills, and any additional training necessary to activate visual motor abilities.', null, 204.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 61, 'Career and technical education rehabilitation training and job placement', '00889', 'Programs that provide adaptive career and technical education training as a method of rehabilitating students with special needs, including those with disabilities. Program support continues beyond the rehabilitation and training phases, and includes job placement services.', null, 208.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Student_Support_Service_Type( Ref_Student_Support_Service_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 62, 'Other', '09999', 'A student support service not yet defined in CEDS is provided to the person or a group of persons.', null, 212.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Supervised_Clinical_Experience( Ref_Supervised_Clinical_Experience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Yes', 'Yes', null, null, 1.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Supervised_Clinical_Experience( Ref_Supervised_Clinical_Experience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'No', 'No', null, null, 2.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Supervised_Clinical_Experience( Ref_Supervised_Clinical_Experience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Not applicable', 'NA', null, null, 3.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Teacher_Education_Credential_Exam( Ref_Teacher_Education_Credential_Exam_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Praxis I', 'Praxis_I', 'Praxis I examination is/was used to assess teacher candidate''s knowledge and skills.', null, 1.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Teacher_Education_Credential_Exam( Ref_Teacher_Education_Credential_Exam_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Praxis II', 'Praxis_II', 'Praxis II examination is/was used to assess teacher candidate''s knowledge and skills.', null, 2.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Teacher_Education_Credential_Exam( Ref_Teacher_Education_Credential_Exam_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'ACTFL', 'ACTFL', 'ACTFL is/was used to assess teacher candidate''s knowledge and skills.', null, 3.00 ); 
